window.bookSummaryJSON = "<p><b>Some say it's better to live as a villain, than to die as a hero. But why choose when you can go back in time and try out each option?</b></p> <p>Ryan \"Quicksave\" Romano has begun a new time-loop. His goal? To prevent New Rome's destruction at the hands of the vicious Meta-Gang. To do so, our favorite courier must explore both sides of the law: to become a corporate superhero in one loop, and a scenery-chewing supervillain in the next!</p> <p>But not is all as it seems. What is this heavy secret that the Dynamis corporation keeps hidden from him? Who is this person who seems to remember events from the previous loop? And most importantly, where did his cashmere suit go?</p>"; 
